import React from "react";
import { Link } from "react-router-dom";
import { getDriverData } from "../../store/adminSlice";
import { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";

export default function DriverScreen(){

    const drivers = useSelector((state)=>state.admin.totalDrivers)

    console.log("drivers variable::",drivers)
    
    const driversNames = [];

    const dispatch = useDispatch();

   useEffect(()=>{
       dispatch(getDriverData())
   },[]);

   drivers.map((eachDriver)=>{
       console.log("E",typeof(eachDriver))
       driversNames.push(eachDriver)
   })

   console.log(typeof(drivers))

   console.log(driversNames)

    return(
        <div>
            
            <h1>Displaying All Drivers</h1>
            <Link to="/admin/addDriver">Add Driver</Link>
            <div>
                {driversNames.map((eD)=>(
                    <div>
                        <h3>{eD.email}</h3>
                    </div>
                ))}
            </div>
        </div>
    )
}
